//use tailwind styles
import {config} from './player.js';

function Form() {
    return (
        <form>
            {Object.keys(config).map((key) => {
                return (
                    <div className="flex flex-col border p-1">
                        <label className="text-xl">{key}</label>
                        {typeof config[key] === 'object' && config[key] !== null ? (
                            <Form object={config[key]}/>
                        ) : (
                            config[key] === true || config[key] === false ? (
                                <input
                                    className="border-2 border-black rounded-md w-5"
                                    type="checkbox"
                                    checked={config[key]}
                                    onChange={(e) => {
                                        config[key] = e.target.checked;
                                    }}
                                />
                            ) : (
                            <input
                                className="border-2 border-black rounded-md"
                                type="text"
                                value={config[key]}
                                onChange={(e) => {
                                    config[key] = e.target.value;
                                }}
                            />
                            ))}
                    </div>
                );
            })}
        </form>
    );
}

export default Form;
